import React, { Component } from 'react';  
import { StyleSheet, Text, View } from 'react-native';  
export default function ChildClass() {
    return (  
        <View style={{alignItems: 'center'}}>  
          <Text style={styles.welcome}>Hello {this.props.name}!</Text>  
        </View>  
    );  
}
